import React from 'react';
import ProjectHeader from '../components/ProjectHeader';

const Portfolio = () => {
    return (
        <>
            <ProjectHeader
                project="my portfolio"
                desc="Web development"
                tools="ReactJS, Adobe XD and Illustrator"
                text="This portfolio was for me an opportunity to create something useful as well as sharpening my skills. I prototyped the portfolio in Adobe XD and developed using ReactJS and CSS. I hope you enjoy.">
            </ProjectHeader>
        </>
    );
};

export default Portfolio;
